import React from 'react';
import './MVB.css'

class MVB extends React.Component {


    render() {
        return(
            <div id="bansContainer">
                <img id="championImg" src={this.props.bans.championImg}/>
                <div id="MVBtext">
                    <div id="MVBWinLoseWinrate">
                        <div id="MVBWinLose">{this.props.bans.win}W {this.props.ban.lose}L</div>
                        <div id="MVBWinrate"></div>
                    </div>
                    <div id="MVBKDA">KDA</div>
                </div>
            </div>
        );
    }

}

export default MVB;
